package com.xtsmm.library.android.webplayer;

import android.annotation.SuppressLint;
import android.app.Activity;
import android.content.pm.ActivityInfo;
import android.graphics.Color;
import android.os.Build;
import android.util.Log;
import android.view.View;
import android.webkit.ConsoleMessage;
import android.webkit.WebChromeClient;
import android.webkit.WebResourceError;
import android.webkit.WebResourceRequest;
import android.webkit.WebView;
import android.webkit.WebViewClient;


public class WebPlayer {

        Activity activity;
        public WebPlayer(Activity activity){
            this.activity=activity;
            activity.setRequestedOrientation(ActivityInfo.SCREEN_ORIENTATION_FULL_SENSOR);

            int currentApiVersion = Build.VERSION.SDK_INT;
            final int flags = View.SYSTEM_UI_FLAG_LAYOUT_STABLE
                    | View.SYSTEM_UI_FLAG_LAYOUT_HIDE_NAVIGATION
                    | View.SYSTEM_UI_FLAG_LAYOUT_FULLSCREEN
                    | View.SYSTEM_UI_FLAG_HIDE_NAVIGATION
                    | View.SYSTEM_UI_FLAG_FULLSCREEN
                    | View.SYSTEM_UI_FLAG_IMMERSIVE_STICKY;

            if (currentApiVersion >= Build.VERSION_CODES.KITKAT) {
                activity.getWindow().getDecorView().setSystemUiVisibility(flags);
                final View decorView = activity.getWindow().getDecorView();
                decorView
                        .setOnSystemUiVisibilityChangeListener(new View.OnSystemUiVisibilityChangeListener() {

                            @Override
                            public void onSystemUiVisibilityChange(int visibility) {
                                if ((visibility & View.SYSTEM_UI_FLAG_FULLSCREEN) == 0) {
                                    decorView.setSystemUiVisibility(flags);
                                }
                            }
                        });
            }
        }
        @SuppressLint("SetJavaScriptEnabled")
        public WebView play(String url,String backgroundImage){
            if(backgroundImage==null){
                backgroundImage="data:image/png;base64,";
            }
            String webdata = "<html><head><style>body{margin:0 auto;padding:0;}#player1{\n" +
                    "position: fixed;\n" +
                    "    top: 0;\n" +
                    "    left: 0;\n" +
                    "    right: 0;\n" +
                    "    bottom: 0;\n" +
                    "    height: 100vh;\n" +
                    "    width: 100vw;\n" +
                    "    z-index: 100000000000000;\n" +
                    "}\n" +
                    "#player1 >div{\n" +
                    "       height: 100%!important;\n" +
                    "    width: 100%!important;\n" +
                    "    z-index: 100000000000000;\n" +
                    "}" +
                    "* {\n" +
                    "\t\t-webkit-user-select: none; /* Safari */        \n" +
                    "\t\t-moz-user-select: none; /* Firefox */\n" +
                    "\t\t-ms-user-select: none; /* IE10+/Edge */\n" +
                    "\t\tuser-select: none; /* Standard */\n" +
                    "\t\t-webkit-touch-callout: none;\n" +
                    "\t\t-webkit-user-select: none;\n" +
                    "\t\t-khtml-user-select: none;\n" +
                    "\t\t-moz-user-select: none;\n" +
                    "\t\t-ms-user-select: none;\n" +
                    "\t\tuser-select: none;\n" +
                    "\t\t-webkit-tap-highlight-color: transparent;\n" +
                    "\t\t}" +
                    "</style>" +
                    "<script type=\"text/javascript\" charset=\"utf-8\" src=\"https://cdn.jsdelivr.net/npm/@clappr/player@latest/dist/clappr.min.js\"></script>" +
                    "</head>"+
                    "<body><div id=\"player1\" style='width:100%;height:100%'></div></body>" +
                    "<script>" +
                    "new Clappr.Player({source: '"+url+"', poster: '"+backgroundImage+"',parentId: '#player1'});</script>" +
                    "</html>"
                    ;
            WebView web=new WebView(activity);
            web.setBackgroundColor(Color.BLACK);
            web.setPadding(0,0,0,0);
            web.getSettings().setDomStorageEnabled(true);
            web.getSettings().setJavaScriptEnabled(true);
            web.getSettings().setJavaScriptCanOpenWindowsAutomatically(true);
            web.setWebViewClient(new WebViewClient() {
                public boolean shouldOverrideUrlLoading(WebView view, String url) {
                    view.loadUrl(url);
                    return true;
                }
                @Override
                public void onReceivedError(WebView view, WebResourceRequest request, WebResourceError error){
                    //Your code to do
                    if (Build.VERSION.SDK_INT >= Build.VERSION_CODES.M) {
                        Log.d("WebView",error.getDescription().toString());
                    }
                }
            });
            web.setWebChromeClient(new WebChromeClient() {
                @Override
                public boolean onConsoleMessage(ConsoleMessage consoleMessage) {
                    android.util.Log.d("WebView", consoleMessage.message());
                    return true;
                }
            });


            web.loadDataWithBaseURL("file:///android_asset/www/",webdata,"text/html","UTF-8",null);
            //web.loadUrl("https://sample.vodobox.com/skate_phantom_flex_4k/skate_phantom_flex_4k.m3u8");
            return web;
        }



}
